import React from "react";
import './ExpenseItem.css';


function Card(props) {
    return (
    <div className="expense-item">
      {/* <div>{props.date.toDateString()}</div> */}
    <div className="expense-item__description">
      <h2>{props.name}</h2>
    </div>
    <div className="expense-item__price">${props.cost}</div>
  </div>
    );
}

export default Card;
